import { Table, Divider, Tag } from 'antd'

class FormWaiting extends Component {
    constructor() {
        super()
        this.state = {
            column: [{
                title: "ลำดับที่",
                dataIndex: ""
            },
            {
                title: "ชื่อ",
                dataIndex: ""
            },
            {
                title: "เบอร์ติดต่อ",
                dataIndex: ""
            },
            {
                title: "E-Mail",
                dataIndex: ""
            },
            {
                title: "linkรถ",
                dataIndex: ""
            },
            {
                title: "สถานะปัจจุบัน",
                dataIndex: ""
            }]
        }
    }
    render() {
        return (<div>
            formwaiting
            <Table columns={this.state.column} />
        </div>)
    }
}

export default FormWaiting
